class child extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( <li class="page-item" key= {number} id={number}>
                    <a class="page-link" onClick={this.handleSubmit} href="#">
                        {number }
                    </a>    
                </li> );
    }
}
 
export default child;
